const response = $input.first().json;

// 실제 데이터 구조에 맞게 파싱
let hospitalData;
try {
 // 배열 형태로 직접 전달된다고 가정
 hospitalData = Array.isArray(response) ? response : [response];
} catch (error) {
 console.error('데이터 파싱 오류:', error);
 hospitalData = [];
}

// 실제 필드명으로 데이터 가공
const processedData = hospitalData.map((hospital, index) => ({
 순번: index + 1,
 기관ID: hospital.hpid || '정보없음',
 기관명: hospital.dutyName || '정보없음',
 주소: hospital.dutyAddr || '정보없음',
 대표전화: hospital.dutyTel1 || '정보없음',
 응급실전화: hospital.dutyTel3 || '정보없음',
 응급실운영: hospital.dutyEryn === 1 ? '운영' : '미운영',
 진료과목: hospital.dgidIdName || '정보없음',
 총병상수: hospital.hpbdn || 0,
 응급실병상수: hospital.hperyn || 0,
 일반병상수: hospital.hpgryn || 0,
 중환자실병상수: hospital.hpicuyn || 0,
 신생아중환자실: hospital.hpnicuyn || 0,
 수술실수: hospital.hpopyn || 0,
 평일진료시작: hospital.dutyTime1s || '정보없음',
 평일진료종료: hospital.dutyTime1c || '정보없음',
 토요진료시작: hospital.dutyTime6s || '정보없음',
 토요진료종료: hospital.dutyTime6c || '정보없음',
 위도: hospital.wgs84Lat || null,
 경도: hospital.wgs84Lon || null,
 응급실가용병상: hospital.hvec || 0,
 일반병상가용: hospital.hvgc || 0,
 중환자실가용: hospital.hvicc || 0,
 신생아중환자실가용: hospital.hvncc || 0,
 수술실가용: hospital.hvoc || 0,
 교통정보: hospital.dutyMapimg || '정보없음',
 기타정보: hospital.dutyInf || '정보없음',
 조회일시: new Date().toLocaleString('ko-KR', {
   timeZone: 'Asia/Seoul',
   year: 'numeric',
   month: '2-digit',
   day: '2-digit',
   hour: '2-digit',
   minute: '2-digit'
 })
}));

// 응급실 운영 기관만 필터링
